# - is sky
# /* is satellite
# *U is ufo
# € is plane

numberOfStars = 0
skipNext = False

for i in range(len(sky)):
    if skipNext:
        skipNext = False
        continue
    
    char = sky[i]
    if  char == '-' or char == '€':
        continue
    if char == '/':
        skipNext = True
        continue
    if char == '*' and sky[i+1] != 'U':
        numberOfStars += 1
print(numberOfStars,"stjärnor upptäckta!")